        splitscreens() {
            const amountOfBeasts = mrbeastVideoDivs.length;
            if (amountOfBeasts <= 0) return;
            let idx = 0;
            for (const beast of mrbeastVideoDivs) {
                const width = (100 / amountOfBeasts);
                beast.style.left = (width * idx) + "%";
                beast.style.width = width + "%";
                idx++;
            }
        }

        misterbeastPITCH(args, util) {
            return this.misterbeast(args, util, null, null, {
                speed: Scratch.Cast.toNumber(args.PITCH) / 100,
            });
        }

        misterbeast(_, util, __, ___, options) {
            const targetId = util.target.id;
            if (mrBeastingTargets[targetId]) return;
            mrBeastingTargets[targetId] = true;
            const mrbeast = "https://penguinmod.site/mrbeast.mp4";
            return new Promise(resolve => {
                const div = document.createElement("div");
                div.style = "position:absolute;left:0px;top:0px;width:100%;height:100%;background:black;z-index:9999999";
                document.body.append(div);

                mrbeastVideoDivs.push(div);

                const video = document.createElement("video");
                video.style = "position:absolute;left:0px;top:0px;width:100%;height:100%;";
                video.volume = 0.5;
                if (options) {
                    video.playbackRate = options.speed;
                    console.log(video.playbackRate);
                }
                video.autoplay = true;
                video.src = mrbeast;
                div.append(video);

                video.onerror = () => {
                    mrbeastVideoDivs.splice(mrbeastVideoDivs.indexOf(div), 1);
                    div.remove();
                    mrBeastingTargets[targetId] = false;
                    resolve();
                };

                video.onended = () => {
                    mrbeastVideoDivs.splice(mrbeastVideoDivs.indexOf(div), 1);
                    div.remove();
                    mrBeastingTargets[targetId] = false;
                    resolve();
                };
            });
        }

